// src/components/Counter.js
import React from 'react';
import { useCounter } from '../store'; // Importe useCounter

function Counter() {
  const { count, increment, decrement } = useCounter(); // Use o hook useCounter

  return (
    <div>
      <h1>Counter App</h1>
      <p>Count: {count}</p>
      <header>
        <h2>Minha Pagina</h2>
        <nav>
          <ul>
            <li><a>inicio</a></li>
            <li><a>de</a></li>
            <li><a>tudo</a></li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default Counter;
